    const baseURL = isDevMode() ? 'http://localhost:3001/' : '/'
    const url = baseURL + 'api/twig?' + paramsString;
    console.log('url', url);
    this.iframeUrl = this.sanitizer.bypassSecurityTrustResourceUrl(url);
  }
}

